script: |
  super -f text -I q6889.spq | sort > q6889.out

inputs:
  - name: q6889.spq
    data: |
      SELECT DISTINCT - CAST ( + col2 AS INTEGER ) AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + - col0 + + col2 + col1 * col0 <> ( - 70 * + col2 );
  - name: tab0

outputs:
  - name: q6889.out
    data: |
